description:
Final, The (2010)  

Verenigde Staten
Horror / Thriller

geregisseerd door Joey Stewart
met Marc Donato, Jascha Washington en Whitney Hoy

Dane is een student die een hoop ellende meegemaakt heeft. Hij is erg wraakzuchtig en heeft zelfmoordneigingen. Samen met een groep andere vernederde studenten besluit hij de populaire studenten eens flink aan te pakken, en ze te laten boeten voor wat ze hen aangedaan hebben. De studenten worden meegenomen naar een afgelegen huis bij een meer. De martelingen volgen...

